import React, { Component } from 'react';
import { ListItem, ListInfo } from '../style.js';

class List extends Component {
	render() {
		return (
			<ListItem>
				<img src="/images/potato.jpg" alt="" />
				<ListInfo>
					<h3>BIRD'S PERFECT BAKED POTATOES</h3>
					<p>Preheat oven to 425 degrees Fahrenheit. Pierce potatoes a few times with a fork. Place oil in a small bowl. Place salt in another small bowl (if using). Place one potato at a time into oil bowl, and roll potato around in oil.</p>
				</ListInfo>
			</ListItem>
		)
	}
}

export default List;
